import React from 'react';
import './SobreMim.css';
import MoniseImagem from '../assets/Monise.jpg';


const SobreMim = () => {
    return (
        <section className="sobreMim">
            <h2>Sobre Mim</h2>
            <div className="sobreMim-content">
                <img src="/monise.jpg" alt="Monise da Silva" className="fotoPerfil"/>
                <p>
                    Olá! Sou Monise da Silva, desenvolvedora Back-End com experiência sólida em tecnologias como
                    Node.js, Java, e no desenvolvimento de sistemas personalizados e sites modernos. Apaixonada por
                    tecnologia e focada em criar soluções digitais personalizadas, estou sempre em busca de novas
                    maneiras de melhorar a eficiência e a qualidade dos projetos que realizo.
                </p>
                <p>
                    Com uma trajetória que passa pelo curso de Tecnologia da Informação da Univesp e por várias
                    especializações na Alura, aplico as melhores práticas de desenvolvimento para oferecer aos meus
                    clientes resultados que realmente fazem a diferença. Minha prioridade é entregar projetos que sejam
                    ágeis, inovadores e que atendam de forma eficaz às necessidades de cada cliente.
                </p>
                <p>
                    Estou entusiasmada para colaborar em projetos de impacto, ajudando empresas e empreendedores a se
                    destacarem no mundo digital. Vamos transformar suas ideias em realidade? Entre em contato e vamos
                    inovar juntos!
                </p>
            </div>
        </section>
    );
};

export default SobreMim;
